import React from "react";

const App = () => {
  let myname = "aashiya";

  let hi = () => {
    return "hello";
  };

  return (
    <>
      <h1>{myname}</h1>
      <button
        onClick={() => {
          hi();
        }}
      >
        click {myname}
      </button>
    </>
  );
};

export default App;
